import React from 'react';
import { FiUpload, FiImage } from 'react-icons/fi';

const UploadPage = () => {
  return (
    <div className="space-y-6">
      {/* Header */}
      <div className="bg-white rounded-lg shadow p-6">
        <h1 className="text-2xl font-bold text-gray-900">Upload Media</h1>
        <p className="text-gray-600 mt-2">
          Upload your images and add metadata.
        </p>
      </div>

      {/* Upload Area */}
      <div className="bg-white rounded-lg shadow p-6">
        <div className="text-center py-12">
          <FiUpload className="mx-auto h-12 w-12 text-gray-400" />
          <h3 className="mt-2 text-sm font-medium text-gray-900">Upload functionality coming soon</h3>
          <p className="mt-1 text-sm text-gray-500">
            This page will feature drag & drop file upload with metadata editing.
          </p>
          <div className="mt-6">
            <button className="btn-primary inline-flex items-center">
              <FiImage className="mr-2 h-4 w-4" />
              Select Files
            </button>
          </div>
        </div>
      </div>
    </div>
  );
};

export default UploadPage;
